public void initialize(URI name, Configuration conf) throws IOException {
  if (fs.getConf() == null) {
    fs.initialize(name, conf);
  }
  String scheme = name.getScheme();
  if (!scheme.equals(fs.getUri().getScheme())) {
    swapScheme = scheme;
  }
}
